description:
Jealous of her sisters engagement, a free spirited skateboarder wants to get more serious with her boyfriend, but he's resisting. For one, he's just met an uber-hot, elegant woman at the office. But when he's forced to meet the girlfriends parents he discovers that his girlfriends mother is the hot client. Embarrassed and awkward, the mother confronts the young man, unleashing pent-up desires between the two. Starring the sizzling new star, Keisha Grey, with Sara Luvv, James Deen, Cody Sky, and Veronica Avluv as the mother who steals the heart of her daughters boyfriend.

Veronica Avluv,Keisha Grey,Sara Luv,Cody Sky,James Deen,Tommy Gunn

